{"0": ["Цепь пришла не товарного вида, темно серого цвета, без блеска, как будто ей 20 лет уже..  ", "2019-07-15T18:56:43.157805727Z", "серебристый", "40", 2, 0, 2, "Цепочка", "Бронницкий ювелир"], "1": ["Цвет у цепочки не серебряный, к сожалению. Жёлтый оттенок какой-то ..отказ", "2019-04-29T10:25:08.221994894Z", "серебристый", "45", 3, 1, 2, "Цепочка", "Бронницкий ювелир"], "3": ["Взяла, но наверное зря, она как белая веревочка, толстовата, не изящная, бес попутал)))", "2016-09-30T16:33:00+03:00", "серебристый", "40", 9, 6, 4, "Цепочка", "Бронницкий ювелир"], "4": ["Ни кому не советую заказывать эту цепочку !!!! Внешне она симпатичная , НО качество отвратительное !!!!! Покупала Ее маме в подарок и через неделю она вся почернела ! Плюс заломы , хотя мама очень аккуратно носить и с др подобными цепочками таких проблем не было! Очень обидно , что мой подарок оказался некчемным куском метала ((((", "2016-09-25T23:17:18+03:00", "серебристый", "50", 14, 2, 1, "Цепочка", "Бронницкий ювелир"], "5": ["не берите! через неделю носки цепочка почернела пятнами по всей длинне! валяется теперь. и что с ней делать???", "2016-09-13T19:23:31+03:00", "серебристый", "45", 14, 0, 1, "Цепочка", "Бронницкий ювелир"], "6": ["Присоединюсь к отрицательным отзывам. Два дня и цепочка из светлой превратилась в черную...", "2016-07-20T10:11:14+03:00", "серебристый", "45", 14, 1, 1, "Цепочка", "Бронницкий ювелир"], "7": ["Дополню отзыв от 20.07. По состоянию на сегодня цепочка просто раскрошилась, как трухлявый пень...", "2016-07-29T06:51:21+03:00", "серебристый", "45", 10, 0, 1, "Цепочка", "Бронницкий ювелир"], "8": ["Хорошая цепочка,сделана шнурком.Серебро светлое, блестящее.Со скидкой купила за 546 руб.", "2016-05-12T20:22:50+03:00", "серебристый", "50", 4, 0, 5, "Цепочка", "Бронницкий ювелир"], "9": ["Хочу продолжить свой отзыв,несколько раз одела цепочку после чего она почернела пятнами и образовались заломы.Обычно такое происходит с дешевой бижутерией . Такое изделие конечно больше никуда не оденешь ,придется выкинуть.Обидно что вместо серебра купила какую то дешевку.", "2016-07-25T19:32:07+03:00", "серебристый", "50", 8, 0, 1, "Цепочка", "Бронницкий ювелир"], "10": ["цепочка почернела быстро и образовались заломы", "2016-05-29T19:43:48+03:00", "серебристый", "45", 12, 0, 1, "Цепочка", "Бронницкий ювелир"], "11": ["Ужасная цепочка, на второй день стала чернеть и похоже на бижутерию видимо из серебра на этой цепочке только проба.", "2016-05-25T21:42:55+03:00", "серебристый", "45", 11, 0, 1, "Цепочка", "Бронницкий ювелир"], "12": ["Вчера первый раз одела и чуть подвеску не потеряла, прям по середине порвалась (ни за что не зацепляла). А так цепочка красивая и блестящая, без пятен", "2016-05-09T09:21:45+03:00", "серебристый", "50", 4, 0, 4, "Цепочка", "Бронницкий ювелир"], "13": ["Очень даже неплохая цепочка", "2016-05-06T19:40:34+03:00", "серебристый", "50", 1, 1, 5, "Цепочка", "Бронницкий ювелир"], "14": ["Цепочка сразу понравилась, хотя и была несколько тускловатая. Надела 4 раза и сейчас она вся в темных пятнах - носить невозможно. Это при том что серебряных вещей начиная с советских  и заканчивая купленными здесь очень много . Ни одна из них не потемнела, даже если сплю не снимая. Считаю что это заводской брак. Очень обидно.", "2016-04-26T11:52:23+03:00", "серебристый", "45", 3, 0, 2, "Цепочка", "Бронницкий ювелир"], "15": ["Изначально пятен не было, просто не очень блестела.  А экспертизы проводить некогда - сайтом пользуюсь потому что нет времени на магазины. Хотя на работе из любопытства могу на химанализ отдать.", "2016-04-26T19:18:49+03:00", "серебристый", "45", 2, 0, 2, "Цепочка", "Бронницкий ювелир"], "16": ["классная, светлая, красивая, но мне 50 оказалась коротка! жаль! со скидками было просто супер! (((", "2016-04-08T13:36:29+03:00", "серебристый", "50", 1, 0, 5, "Цепочка", "Бронницкий ювелир"], "17": ["запала она мне в душу.....заказала опять 50 см. для мелких подвесок на лето подойдет. со скидкой вышла в 567 руб. оставила, довольна! )))", "2016-04-22T10:20:45+03:00", "серебристый", "50", 2, 0, 5, "Цепочка", "Бронницкий ювелир"], "18": ["Премилая цепочка. Плетение как шнурок. Светлая. Проба на месте. Покупала для девушки-подростка. В самый раз.", "2016-04-15T23:46:53+03:00", "серебристый", "50", 1, 0, 5, "Цепочка", "Бронницкий ювелир"], "19": ["Очень хорошая цепочка. В сечении круглая, как шнурок.", "2016-04-15T00:19:49+03:00", "серебристый", "45", 2, 1, 5, "Цепочка", "Бронницкий ювелир"], "20": ["Цепочка понравилась, хорошая, прочная - так казалось во время покупки. В первый же день появился залом, носила аккуратно. Разочарована.", "2016-04-03T00:40:45+03:00", "серебристый", "45", 5, 0, 4, "Цепочка", "Бронницкий ювелир"], "21": ["КРАСИВАЯ ЦЕПОЧКА,ВСЕ УСТРАИВАЕТ В НЕЙ,ТОНКАЯ,ЧТО Я И ХОТЕЛА,ЦЕНА СО СКИДКОЙ ВООБЩЕ БОЛЬШОЙ ПЛЮС.МИНУСОВ НЕ ВИЖУ.", "2016-04-02T09:42:07+03:00", "серебристый", "45", 1, 0, 5, "Цепочка", "Бронницкий ювелир"], "22": ["Цепочка хороша. Цвет, качество - все устраивает. Со скидкой 520 р. Минусов 2 - неудобный маленький замочек и очень тонкая для меня. На детской и юной шейке будет смотреться, на взрослой женщине - несолидно. Пришлось отказаться, заказывала 40 и 45 см.", "2016-03-31T15:48:53+03:00", "серебристый", "45", 3, 1, 4, "Цепочка", "Бронницкий ювелир"], "23": ["Мне тоже понравилась.Вес 5,4 гр. Цена  504 - даром!Да, светлая,но и подвесок светлых полно.Очень нежная!!!Спасибо за фото в галерее -  именно оно сподвигло на покупку!", "2016-03-20T11:16:12+03:00", "серебристый", "50", 9, 0, 5, "Цепочка", "Бронницкий ювелир"], "24": ["Прекрасная цепочка, гладкая, тоненькая. Никакого желтоватого отлива не заметила. Размер 40 - практически под горло взрослому, но я брала для ребенка на крестик, сыну 5-лет хорошо.", "2016-03-17T17:10:06+03:00", "серебристый", "40", 3, 3, 5, "Цепочка", "Бронницкий ювелир"], "25": ["Цепочка отличная , длину бы побольше, взяла к подвеска крестик. Супер!", "2016-03-17T15:30:41+03:00", "серебристый", "50", 2, 0, 5, "Цепочка", "Бронницкий ювелир"], "26": ["Отличная цепочка-веревочка. Никакого светло желтого оттенка (в предыдущем отзыве было) не заметила. Качественное плетение, хороший замок, вес (при длине 50см) - 5.18 гр.", "2016-03-17T14:39:02+03:00", "серебристый", "50", 3, 0, 5, "Цепочка", "Бронницкий ювелир"], "27": ["Цепочка вообще непонятного цвета. Сильно светлая и желтоватая. Вообще не подходит ни под один мой кулон.", "2016-01-28T07:23:30+03:00", "серебристый", "40", 4, 1, 3, "Цепочка", "Бронницкий ювелир"], "28": ["По качеству претензий нет - цепочка классная. Но отказ - потому что, во-первых, светло-светло-серого цвета, во-вторых,  без глянцевого блеска, и подвеску подходящую еще надо побегать поискать.", "2016-01-15T14:55:02+03:00", "серебристый", "50", 3, 1, 3, "Цепочка", "Бронницкий ювелир"], "29": ["Цепочка супер !  Тонкая и элегантная.Не написано родированное ли серебро.Если да,то просто отлично.\r\nРекомендую.Качество отменное.Цена смешная - 541 руб.Ждите скидки и берите ))))))", "2016-01-11T13:45:34+03:00", "серебристый", "50", 7, 0, 5, "Цепочка", "Бронницкий ювелир"]}
